import React from 'react'
import { Link } from 'react-router-dom'

export default function HomePage() {
  return (
    <div className="container">
      <h1>GitHub Data</h1>
      <p>
        <Link to="/dylanhulbert">Dylan Hulbert</Link> on GitHub.
      </p>
    </div>
  )
}
